import { Link } from "react-router-dom"
import "../styles/Menu.css"

const Menu =()=>{
    return(
            <nav  className="nav">
                <Link cl to="/accueil">Accueil</Link>
                <Link to="/recherche">Recherche</Link>
                <Link to="/bibliotheque">Bibliotheque</Link>
                <Link to="/ajouterPlaylist">AjouterPlaylist </Link>
            </nav>
    )
}
export default Menu
